import { Container, Jumbotron } from "reactstrap";

function Home() {
  return (
    <>
      <Head>
        <title>Home - Celke</title>
        <meta name="description" content="Site de ... sobre..." />
      </Head>

      <Jumbotron>
        <Container>
          <h1 className="text-center">Titulo</h1>
        </Container>
      </Jumbotron>
    </>
  );
}

export default Home;
